const initialState = {
    isLoading: true,
    isInitDataFetchError: false,
    fields: {},
    crmName: '',
    hasCrmIntegration: true,
};

export default function loginReducer(state = false, action) {
    switch (action.type) {
        case 'LOGIN':
            return true;
        case 'SIGN-UP':
            return true;
        default:
            return state;
    }
}
